import React from "react";
import { Bar } from "react-chartjs-2";
import { CategoryScale } from 'chart.js';
import Chart from 'chart.js/auto';

const GuidesChart = () => {
  Chart.register(CategoryScale);
  const barChartData = {
    labels: ["Ene", "Feb", "Mar", "Mar","Abr","May","Jun","Jul",
    "Ago", "Sep", "Oct", "Nov", "Dic"
  ],
    datasets: [
      {
        data: [200, 350, 275],
        label: {
          display: false,
        },
        borderColor: "#3333ff",
        backgroundColor: "pink",
        fill: true
      },
      {
        data: [200, 200, 200],
        label: "Deaths People",
        borderColor: "#ff3333",
        backgroundColor: "yellow",
        fill: true
      }
    ]
  };

  const barChart = (
    <Bar
      type="bar"
      width={70}
      height={20}
      options={{
        title: {
          display: false,
          text: "COVID-19 Cases of Last 3 Months",
          fontSize: 15
        },
        legend: {
          display: false, //Is the legend shown?
          position: "top" //Position of the legend.
        },

      }}
      data={barChartData}
    />
  );
  return barChart;
};

export default GuidesChart;
